import React from "react";
import { Link,BrowserRouter as Router, } from "react-router-dom";

const Nav = () => {
  return (
    <>
 
      <div>
        <ul>
        <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/students">Students</Link>
          </li>
          <li>
            <Link to="/user">User</Link>
          </li>
        </ul>
      </div>
      
    </>
  );
};

export default Nav;
